[application]

name="alAkhira"
main_scene="res://env/scenes/testroom.xml"
icon="res://icon.png"
boot_logo=img(rgba, 0, 512, 512, )
boot_bg_color=#ff000000
target_fps=60

[autoload]

SUTjoystick="res://scripts/SUTjoystick.gd"

[debug]

indicators_enabled=true
print_clicked_control=true
print_metrics=true
verbose_stdout=true
image_load_times=true
script_max_call_stack=1024
print_fps=true

[display]

width=800
height=600
resizable=true
driver="GLES2"
stretch_mode="disabled"
fullscreen=false

[image_loader]

filter=true
gen_mipmaps=true
repeat=true

[input]

ui_accept=[key(Return), key(Enter), key(Space), jbutton(0, 0)]
ui_cancel=[key(Escape), jbutton(0, 1)]
ui_left=[key(Left), jbutton(0, 14)]
ui_right=[key(Right), jbutton(0, 15)]
ui_up=[key(Up), jbutton(0, 12)]
ui_down=[key(Down), jbutton(0, 13)]
move_forward=[key(W), jaxis(0, 1)]
move_backwards=[key(S), jaxis(0, 1)]
move_left=[key(A), jaxis(0, 0)]
move_right=[key(D), jaxis(0, 0)]
jump=[key(Space), jbutton(0, 0)]
camera_down=[jaxis(0, 4), key(Up)]
camera_up=[jaxis(0, 4), key(Down)]
camera_left=[jaxis(0, 3), key(Left)]
camera_right=[jaxis(0, 3), key(Right)]
attack=[jbutton(0, 2), mbutton(0, 1)]
grab=[jbutton(0, 1), key(E)]
cast=[jbutton(0, 4), key(Shift)]
dodge=[jbutton(0, 3), key(Q)]

[physics]

fixed_fps=60

[rasterizer]

shadow_filter=1
fp16_framebuffer=true
trilinear_mipmap_filter=true

[render]

thread_model=1
shadows_enabled=true
room_cull_enabled=false
light_discard_enabled=true
mipmap_policy=0
default_clear_color=#ff4c4c4c
